import { useState} from "react";
import data from "../data.js";

 

function Main (){



    return(
    <div>
    <h1>심리테스트</h1>
    {
    data.map(function(test , i){
        return(
            <h4> {test.text} </h4>
        )
    })}
        
        <Modal/>
    </div>
    )
}

function Modal(){
    return(
      <div>
        동의
      </div>
    )
  }

export default Main;
